def spaced_subset(lst, m):
    """
    Selects m items from lst, spaced as evenly as possible, including the first and last items.

    :param lst: List of k items.
    :param m: Number of items to select.
    :return: A list of m items.
    """
    if m < 2:
        raise ValueError("Subset size m must be at least 2 to include the first and last items.")
    if m > len(lst):
        raise ValueError("Subset size m cannot exceed the length of the original list.")

    # Indices of the original list to include in the subset
    indices = [round(i * (len(lst) - 1) / (m - 1)) for i in range(m)]

    # Collect the items at the calculated indices
    return [lst[int(index)] for index in indices]

